import React from 'react';
import Post from '../Post/Post';

const Posts = ({ posts = [] }) => {
    console.log('posts', posts);
    return (
        <>
            {posts.map((post) => (
                <Post key={post.id} post={post} />
            ))}
        </>
    );
};

export default Posts;
